import React, { useState } from "react";
import { Swiper, SwiperSlide } from "swiper/react";
import { Autoplay, Pagination, Navigation, EffectFade } from "swiper";

import "swiper/css";
import "swiper/css/pagination";
import "swiper/css/navigation";
import "swiper/css/effect-fade";

import Payment from "./Payment";
import ImageSlider from "./ImageSlider";
import { FaMapMarkerAlt, FaPhoneAlt, FaEnvelope } from "react-icons/fa";
import ContactModal from "./ContactModal";

function HomePage1() {
  const [showPayment, setShowPayment] = useState(false);
  const [showContactModal, setShowContactModal] = useState(false);

  return (
    <div className="container">
      {/* ===== Navbar ===== */}
      <nav className="nav">
        <div className="logo">Arunodaya</div>
        <ul className="nav-links">
          <li>
            <button
              className="linkBtn"
              onClick={() =>
                window.scrollTo({ top: 0, behavior: "smooth" })
              }
            >
              Home
            </button>
          </li>
          <li>
            <button className="linkBtn" onClick={() => setShowPayment(true)}>
              Donate
            </button>
          </li>
          <li>
            <button className="linkBtn" onClick={() => setShowContactModal(true)}>
              Contact
            </button>
          </li>
        </ul>
      </nav>

      {/* ===== Hero Section with Slider ===== */}
      <div className="hero">
        <Swiper
          modules={[Autoplay, Pagination, Navigation, EffectFade]}
          effect="fade"
          autoplay={{ delay: 4000, disableOnInteraction: false }}
          pagination={{ clickable: true }}
          navigation
          loop
          className="mySwiper"
        >
          <SwiperSlide>
            <div className="slide" style={{ backgroundImage: `url('https://source.unsplash.com/random/1920x1080?education')` }}>
              <div className="overlay">
                <h1>Empowering Education</h1>
                <p>Together we can bring knowledge to every child.</p>
              </div>
            </div>
          </SwiperSlide>
          <SwiperSlide>
            <div className="slide" style={{ backgroundImage: `url('https://source.unsplash.com/random/1920x1080?community')` }}>
              <div className="overlay">
                <h1>Building Communities</h1>
                <p>Helping hands create brighter futures.</p>
              </div>
            </div>
          </SwiperSlide>
          <SwiperSlide>
            <div className="slide" style={{ backgroundImage: `url('https://source.unsplash.com/random/1920x1080?children')` }}>
              <div className="overlay">
                <h1>Support Children</h1>
                <p>Your small contribution makes a big difference.</p>
              </div>
            </div>
          </SwiperSlide>
        </Swiper>
      </div>

      {/* ===== Payment Modal ===== */}
      {showPayment && <Payment onClose={() => setShowPayment(false)} />}

      {/* ===== Contact Modal ===== */}
      {showContactModal && <ContactModal onClose={() => setShowContactModal(false)} />}

      {/* ===== Footer ===== */}
      <footer className="footer">
        <div className="footer-content">
          <p>Â© 2025 Arunodaya. All rights reserved.</p>
          <div className="footer-icons">
            <FaMapMarkerAlt /> <span>123 NGO Street, City</span>
            <FaPhoneAlt /> <span>+91 9876543210</span>
            <FaEnvelope /> <span>info@arunodaya.org</span>
          </div>
        </div>
      </footer>
    </div>
  );
}

export default HomePage1;
